import axios from 'axios';
import ACTIONS from './index';



export const dispatchLogin = () => {
    return {
        type: ACTIONS.LOGIN
    }
}

export const fetchUser = async () => {
    const res = await axios.get('/user/user_info')
    return {
        type: ACTIONS.LOGIN
    }
}
